import React,{Component} from 'react';
import "./Header.css"
class Header extends Component{
     menuItems = require('../../menuItems.json')
    render(){

        return(
            <div className="header-container">
               {this.renderButtonsContainer()}
            </div>
        );
    }


    renderButtonsContainer(){
       return this.menuItems.map((menuItem)=>{
            const {title,path} = menuItem
            return this.renderButton(title,path) })
    }


    renderButton(title,path){
        return <button className="menu-item-button">{title}</button>
    }
}

export default Header;
